INSERT INTO `planets` VALUES ('Kepler-16 (AB) b is a circum-binary planet. It is orbiting two stars. The visualizations below are therefore not accurate. The masses of the stars are 0.20255 and 0.6897 solar masses. The orbit of the binary stars and the planet are perfectly alligned within half a degree. This suggests that the planet formed in a circumbinary disc. ','transit',2011,'Kepler 16','This image shows an artist`s illustration of the Kepler-16 (AB) b exo-planet orbiting two binary stars. Credit: NASA/JPL-Caltech/R. Hurt','/Date(1447045200000)/',1,'Kepler-16 (AB) b','false','null',7420251,12984878,'undefined',1334965472,7420250,12984878,'undefined',1334965472,'0.333','0.0069','90.0322','228.776','0.7048'),('','RV',2009,'','','/Date(1223524800000)/',1,'HD 28254 b','false','null',7419942,12984878,'undefined',1334965471,7419941,12984878,'undefined',1334965471,'1.16','0.81','0','1116','2.15'),('The star HD 28678 hosts a Jupiter-like planet. It was discovered as part of a Doppler survey at the Keck Observatory.','RV',2011,'','','/Date(1699419600000)/',1,'HD 28678 b','false','null',7419944,12984878,'undefined',1334965471,7419943,12984878,'undefined',1334965471,'1.7','0.168','0','387.1','1.24'),('The star HD 30856 hosts a Jupiter-like planet. It was discovered as part of a Doppler survey at the Keck Observatory.','RV',2011,'','','/Date(1699419600000)/',1,'HD 30856 b','false','null',7419952,12984878,'undefined',1334965471,7419951,12984878,'undefined',1334965471,'1.8','0','0','912','2'),('The star HD 5891 hosts a Jupiter-like planet. It was discovered as part of a Doppler survey at the Keck Observatory.','RV',2011,'','','/Date(1699419600000)/',1,'HD 5891 b','false','null',7420054,12984878,'undefined',1334965471,7420053,12984878,'undefined',1334965471,'7.6','0.066','0','177.11','0.76'),('','timing',2009,'','','/Date(1037077200000)/',2,'HU Aqr(AB) b','false','null',7420227,12984878,'undefined',1334965471,7420226,12984878,'undefined',1334965471,'5.4','0.075','0','2359','3.45'),('','timing',2011,'','','/Date(1037077200000)/',2,'HU Aqr(AB) c','false','null',7420228,12984878,'undefined',1334965471,7420226,12984878,'undefined',1334965471,'5.9','0.29','0','5646','6.18'),('This planet candidate was discovered with the Kepler spacecraft. Its host star gets periodically fainter whenever the planet is in front of the star. Because there are multiple phenomena that can create a signal that looks similar to a planetary transit, the candidates have to be confirmed with another method. For Kepler-23 the planetary nature of the companions has been confirmed by transit timing variations, caused by other planets in the system, and a stability analysis. However, the mass of the planets is not well constrained yet and should be considered an upper limit. ','transit',2012,'','','/Date(1796101200000)/',2,'Kepler-23 b','false','null',7420271,12984878,'undefined',1334965472,7420270,12984878,'undefined',1334965472,'0.8','0','0','7.1073','0.075'),('This planet candidate was discovered with the Kepler spacecraft. Its host star gets periodically fainter whenever the planet is in front of the star. Because there are multiple phenomena that can create a signal that looks similar to a planetary transit, the candidates have to be confirmed with another method. For Kepler-23 the planetary nature of the companions has been confirmed by transit timing variations, caused by other planets in the system, and a stability analysis. However, the mass of the planets is not well constrained yet and should be considered an upper limit. ','transit',2012,'','','/Date(1796101200000)/',2,'Kepler-23 c','false','null',7420272,12984878,'undefined',1334965472,7420270,12984878,'undefined',1334965472,'0.8','0','0','10.7421','0.099'),('This planet candidate was discovered with the Kepler spacecraft. Its host star gets periodically fainter whenever the planet is in front of the star. Because there are multiple phenomena that can create a signal that looks similar to a planetary transit