ially available cameras. New observations from NASA`s Hubble Space Telescope show that it is a waterworld enshrouded by a thick, steamy atmosphere. GJ1214b represents a new type of planet, like nothing seen in our solar system or any other planetary system currently known.','transit',2009,'Gliese 1214b','This image shows an artist`s view of the planet Gliese 1214 b in front of its host star. \n	\nCredit: NASA, ESA, and D. Aguilar (Harvard-Smithsonian Center for Astrophysics).','/Date(1192161600000)/',1,'Gliese 1214 b','false','null',7419387,12984878,'undefined',1334965470,7419386,12984878,'undefined',1334965470,'0.02','0.27','88.8','1.58040488','0.014'),('The star Gliese 170 is located in the constellation Orion. The planet was discovered with the Keck Observatory on Mauna Kea in Hawaii.','RV',2010,'','','/Date(1570075200000)/',1,'Gliese 179 b','false','null',7419391,12984878,'undefined',1334965470,7419390,12984878,'undefined',1334965470,'0.82','0.21','0','2288','2.41'),('','RV',2011,'','','/Date(1193976000000)/',1,'Gliese 3634 b','false','null',7419398,12984878,'undefined',1334965470,7419397,12984878,'undefined',1334965470,'0.022','0.08','59','2.64561','0.0287'),('Gliese 581 is a red dwarf in the constellation Libra. It is the 89th closest star to the Solar System. In late 2010, US astronomers annoucent a planet in the habitable zone. This statement has been challenged by the European HARPS team. Gliese 581 c is likely to have a runaway greenhouse effect. A radio message has been sent to Gliese 581 in 2008 and will reach the star system in 2029.','RV',2005,'','','/Date(1383973200000)/',4,'Gliese 581 b','false','null',7419404,12984878,'undefined',1334965470,7419403,12984878,'undefined',1334965470,'0.05','0.031','0','5.36865','0.041'),('Gliese 581 is a red dwarf in the constellation Libra. It is the 89th closest star to the Solar System. In late 2010, US astronomers annoucent a planet in the habitable zone. This statement has been challenged by the European HARPS team. Gliese 581 c is likely to have a runaway greenhouse effect. A radio message has been sent to Gliese 581 in 2008 and will reach the star system in 2029.','RV',2007,'','','/Date(1383973200000)/',4,'Gliese 581 c','false','null',7419405,12984878,'undefined',1334965470,7419403,12984878,'undefined',1334965470,'0.017','0.07','0','12.9182','0.073'),('Gliese 581 is a red dwarf in the constellation Libra. It is the 89th closest star to the Solar System. In late 2010, US astronomers annoucent a planet (Gliese 581f) in the habitable zone. This statement has been challenged by the European HARPS team. Gliese 581 d might be habitable according to a paper by Wordsworth et al. (2011) who studied the system using three dimensional climate simulations. A radio message has been sent to Gliese 581 in 2008 and will reach the star system in 2029.','RV',2007,'','','/Date(1383973200000)/',4,'Gliese 581 d','false','null',7419406,12984878,'undefined',1334965470,7419403,12984878,'undefined',1334965470,'0.019','0.25','0','66.64','0.22'),('Gliese 581 is a red dwarf in the constellation Libra. It is the 89th closest star to the Solar System. In late 2010, US astronomers annoucent a planet in the habitable zone. This statement has been challenged by the European HARPS team. Gliese 581 c is likely to have a runaway greenhouse effect. A radio message has been sent to Gliese 581 in 2008 and will reach the star system in 2029.','RV',2009,'','','/Date(1383973200000)/',4,'Gliese 581 e','false','null',7419407,12984878,'undefined',1334965470,7419403,12984878,'undefined',1334965470,'0.0061','0.32','0','3.14945','0.028'),('Gliese 667 C is a member of a triple star system in the constellation Scorpius. The system contains at least two planets.','RV',2009,'','','/Date(1007269200000)/',2,'Gliese 667C b','false','null',7419411,12984878,'undefined',1334965470,7419410,12984878,'undefined',1334965470,'0.019','0','0','7.2','0.05'),('Gliese 667 C is a member of a triple star system in the constellation Scorpius.