471,'0.38','0.41','0','1244','2.35'),('This planetary system is most likely in a 2:1 mean motion resonance. The inner planet orbits the star exactly twice during one orbit of the outer planet. This is a very stable configuration. Mean motion resonances help us to understand the formation of multiplanteray systems. The existense of this resonance is a strong indication that interactions with the protoplanetary disk migrated the planets to their current positions. A detailed analysis of the HD 128311 system shows that there also had to be non-adiabatic effects during the migration phase such as a third planet (Sandor and Kley 2006) or turbulence in the protoplanetary disk (Rein and Papaloizou 2009).','RV',2002,'','','/Date(1099285200000)/',2,'HD 128311 b','false','null',7419616,12984878,'undefined',1334965471,7419615,12984878,'undefined',1334965471,'2.18','0.25','0','448.6','1.099'),('This planetary system is most likely in a 2:1 mean motion resonance. The inner planet orbits the star exactly twice during one orbit of the outer planet. This is a very stable configuration. Mean motion resonances help us to understand the formation of multiplanteray systems. The existense of this resonance is a strong indication that interactions with the protoplanetary disk migrated the planets to their current positions. A detailed analysis of the HD 128311 system shows that there also had to be non-adiabatic effects during the migration phase such as a third planet (Sandor and Kley 2006) or turbulence in the protoplanetary disk (Rein and Papaloizou 2009).','RV',2005,'','','/Date(1320465600000)/',2,'HD 128311 c','false','null',7419617,12984878,'undefined',1334965471,7419615,12984878,'undefined',1334965471,'3.21','0.17','50','919','1.76'),('','RV',1999,'','','/Date(1223784000000)/',1,'HD 130322 b','false','null',7419621,12984878,'undefined',1334965471,7419620,12984878,'undefined',1334965471,'1.02','0.044','76','10.72','0.088'),('This planet is part of a large data release by the Euopea