2,'0.022','0','0','1.592851','0.0273'),('The planet KOI-55 b is orbiting a former red-giant star. It probably survived deep immersion in the red-giant`s envelope. When the star ran out of hydrogen after about 10 billion years, it swelled dramatically. Our own sun will also undergo this phase and expand as far as the Earth`s orbit. The planet that we see today in the KOI-55 system might just be the dense core of an evaporated giant planet which survived the death of its sun. The planet was discovered with the Kepler spacecraft but is not transiting. It is inferred from brightness pulsations.','imaging',2011,'','','/Date(1480568400000)/',2,'KOI-55 b','false','null',7420344,12984878,'undefined',1334965472,7420343,12984878,'undefined',1334965472,'0.014','0','0','0.2401','0.006'),('The planet KOI-55 c is orbiting a former red-giant star. It probably survived deep immersion in the red-giant`s envelope. When the star ran out of hydrogen after about 10 billion years, it swelled dramatically. Our own sun will also undergo this phase and expand as far as the Earth`s orbit. The planet that we see today in the KOI-55 system might just be the dense core of an evaporated giant planet which survived the death of its sun. The planet was discovered with the Kepler spacecraft but is not transiting. It is inferred from brightness pulsations.','imaging',2011,'','','/Date(1480568400000)/',2,'KOI-55 c','false','null',7420345,12984878,'undefined',1334965472,7420343,12984878,'undefined',1334965472,'0.0021','0','0','0.34289','0.0076'),('The planetary system KOI-730 has been discovered by Kepler. The planet masses have not been confirmed. However, a dynamical study by Fabrycky et al suggests that this system is real.','transit',2011,'','','/Date(1194584400000)/',4,'KOI-730 b','false','null',7420347,12984878,'undefined',1334965472,7420346,12984878,'undefined',1334965472,'0','0','0','14.7903','0.12'),('The planetary system KOI-730 has been discovered by Kepler. The planet masses have not been 