false','null',7420338,12984878,'undefined',1334965472,7420337,12984878,'undefined',1334965472,'0.505','0.11','87','2.455239','0.027'),('This planet has been discovered in data from the 2006-2007 MOA project by Bennett et al (2012). It is the first planetary event in which the stellar host is only detected through binary microlensing events. Note that the discovery paper has not been published in a peer-reviewed journal yet. ','microlensing',2012,'','','/Date(1670043600000)/',1,'MOA-bin-1 b','true','null',7420374,12984878,'undefined',1334965472,7420373,12984878,'undefined',1334965472,'3.7','0','0','0','8.3'),('','timing',1992,'','','/Date(1665547200000)/',3,'PSR 1257 12 b','false','null',7420424,12984878,'undefined',1334965472,7420423,12984878,'undefined',1334965472,'0.00007','0','0','25.262','0.19'),('','timing',1992,'','','/Date(1665547200000)/',3,'PSR 1257 12 c','false','null',7420425,12984878,'undefined',1334965472,7420423,12984878,'undefined',1334965472,'0.013','0.0186','53','66.5419','0.36'),('','timing',1992,'','','/Date(1665547200000)/',3,'PSR 1257 12 d','false','null',7420426,12984878,'undefined',1334965472,7420423,12984878,'undefined',1334965472,'0.012','0.0252','47','98.2114','0.46'),('The 5.7ms pulsar PSR J1719-14 shows timing variations on a 2.17 hour timescale. These can be explained with a Jovian planet. However, because of the planet`s short distance to the star, its density has to be more then 20 times that of Jupiter. The planet is most likely a remnant of a binary star which avoided complete destruction. The chemical composition, pressure and dimensions of the planet indicate that it is crystallized, or in other words, a very big diamond (Bailes et al 2011).  ','timing',2011,'','','/Date(1762578000000)/',1,'PSR 1719-14 b','false','null',7420428,12984878,'undefined',1334965472,7420427,12984878,'undefined',1334965472,'1.2','0','0','0.0904','0.00442'),('This planet has been announced at the Extreme Solar Systems II conference in Jackson Hole by the WA