','0.83'),('The star 14 Herculis is only 59 light years away in the constellation Hercules. However, because it is an orange dwarf star it can not be seen with the naked eye. There is only one confirmed planet in the system, but a dynamical analysis suggests that they might be two planets locked in a 4:1 mean motion resonance.','RV',2002,'','','/Date(1189396800000)/',1,'14 Her b','false','null',7419251,12984878,'undefined',1334965470,7419250,12984878,'undefined',1334965470,'4.64','0.369','0','1773.4','2.77'),('16 Cygni ABC is a hierachical triple system. The star is in the Kepler field of view. In an active search for extra-terrestrial intelligence a radio message has been sent to this system on May 24 1999. It will reach the system in 2069.','RV',1996,'','','/Date(1189396800000)/',1,'16 Cyg B b','false','null',7419253,12984878,'undefined',1334965470,7419252,12984878,'undefined',1334965470,'1.68','0.689','0','799.5','1.68'),('18 Delphini is a star in the constellation of Delphinus.','RV',2008,'','','/Date(1596340800000)/',1,'18 Del b','false','null',7419255,12984878,'undefined',1334965470,7419254,12984878,'undefined',1334965470,'10.3','0.08','0','993.3','2.6'),('14 Sextantis is located in the constellation of Sextans. The two planets in the system are in a 2:1 mean motion resonance.','RV',2010,'','','/Date(1854504000000)/',2,'24 Sex b','false','null',7419259,12984878,'undefined',1334965470,7419258,12984878,'undefined',1334965470,'1.99','0.09','0','452.8','1.333'),('14 Sextantis is located in the constellation of Sextans. The two planets in the system are in a 2:1 mean motion resonance.','RV',2010,'','','/Date(1854504000000)/',2,'24 Sex c','false','null',7419260,12984878,'undefined',1334965470,7419258,12984878,'undefined',1334965470,'0.86','0.29','0','883','2.08'),('2M1207 might be the first directly imaged extrasolar planet. However, due to its high mass it might also classify as a brown dwarf.','imaging',2004,'2M1207','This image shows the brown dwarf 2M1207 and a 