e cycle is similar to the Sun`s 11 year cycle.','RV',2009,'','','/Date(1417496400000)/',2,'Gliese 433 b','false','null',7419400,12984878,'undefined',1334965470,7419399,12984878,'undefined',1334965470,'0.0182','0.08','0','7.3709','0.058'),('The star Gliese 436 is located in the constellation Leo. Due to tidal forces the planet Gliese 436b is expected to circularise on short timescales. It might be perturbed by an additional planet in the system.','transit',2004,'','','/Date(1318219200000)/',1,'Gliese 436 b','false','null',7419402,12984878,'undefined',1334965470,7419401,12984878,'undefined',1334965470,'0.0737','0.15','85.8','2.64389849','0.02887'),('Gliese 649 is a red dwarf with about half the mass and size of our Sun in the constellation Hercules.','RV',2009,'','','/Date(1505188800000)/',1,'Gliese 649 b','false','null',7419409,12984878,'undefined',1334965470,7419408,12984878,'undefined',1334965470,'0.328','0.3','0','598.3','1.135'),('Gliese 676 is a binary star system in the constellation Ara. Because of the low mass host star, the planet Gliese 676A b takes 1000 days to complete an orbit at a semi-major axis of only 1.6 astronomical units.','RV',2009,'','','/Date(1699678800000)/',1,'Gliese 676A b','false','null',7419416,12984878,'undefined',1334965471,7419415,12984878,'undefined',1334965471,'4','0.29','0','989','1.61'),('The planetary system around the star HD 192310 consists of two Neptune-mass planets and is located in the constellation of Capricornus. ','RV',2010,'','','/Date(1541653200000)/',2,'Gliese 785 b','false','null',7419418,12984878,'undefined',1334965471,7419417,12984878,'undefined',1334965471,'0.05316','0.13','0','74.72','0.32'),('The planetary system around the star HD 192310 consists of two Neptune-mass planets and is located in the constellation of Capricornus. The outer planet Gliese 785 c is at the outer edge of the habitable zone.','RV',2011,'','','/Date(1541653200000)/',2,'Gliese 785 c','false','null',7419419,12984878,'undefined',1334965471,7419417,12984878,'undefined',1334965471,'0.0754','0.32','0','525.8','1.18'),('The star Gliese 832 is a star located in the solar neighbourhood in the constallation Grus. Therefore the observed planet Gliese 832 b is a good candidate for astrometric observations.','RV',2008,'','','/Date(1381464000000)/',1,'Gliese 832 b','false','null',7419421,12984878,'undefined',1334965471,7419420,12984878,'undefined',1334965471,'0.64','0.12','0','3416','3.4'),('The star Gliese 849 is a red dwarf in the constellation of Aquarius.','RV',2006,'','','/Date(1699678800000)/',1,'Gliese 849 b','false','null',7419423,12984878,'undefined',1334965471,7419422,12984878,'undefined',1334965471,'0.99','0.04','0','1852','2.35'),('The star Gliese 86 is a K-type dwarf star and a member of a binary system in the constellation Eridanus. A linear trend in the radial velocity data may be associated with the stellar companion or another planetary companion.','RV',2000,'','','/Date(1189396800000)/',1,'Gliese 86 b','false','null',7419425,12984878,'undefined',1334965471,7419424,12984878,'undefined',1334965471,'4.01','0.046','0','15.766','0.11'),('Gliese 876 is a red dwarf only 15 light years from Earth in the constellation Aquarius. The orbits of the outer three planets are locked in a Laplace reasonance. This resonance is also present in the moons of Jupiter: Io, Europa, Ganymede. This strong dynamical interaction leads to interesting conclusions about the formation history of the system. It is a very strong indication that the planets migrated in the protoplanetary disk to their current position and got locked into mean motion resonances during that process.','RV',2000,'','','/Date(1320465600000)/',4,'Gliese 876 b','false','null',7419427,12984878,'undefined',1334965471,7419426,12984878,'undefined',1334965471,'2.2756','0.0324','84','61.1166','0.208317'),('Gliese 876 is a red dwarf only 15 light years from Earth in the constellation Aquarius. The orbits of the outer three planets are locked in a Laplace reasonan