rois et al., NRC Canada.','/Date(1384059600000)/',4,'HR 8799 b','false','null',7420222,12984878,'undefined',1334965471,7420221,12984878,'undefined',1334965471,'7','0','28','164250','68'),('The star HR 8799 is a young star in the constellation of Pegasus. It hostst a debri disk and at least 3 planets. The objects are near the upper limit for being planets. Objects are classified as brown dwarfs if they are capable of deuterium fusion (above 13 Jupiter masses).','imaging',2008,'HR 8799','This image shows three planets orbiting the star HR 8799. It was optained with the Keck II telescope on Hawaii. Credit: C. Marois et al., NRC Canada.','/Date(1384059600000)/',4,'HR 8799 c','false','null',7420223,12984878,'undefined',1334965471,7420221,12984878,'undefined',1334965471,'10','0','28','82145','42.9'),('The star HR 8799 is a young star in the constellation of Pegasus. It hostst a debri disk and at least 3 planets. The objects are near the upper limit for being planets. Objects are classified as brown dwarfs if they are capable of deuterium fusion (above 13 Jupiter masses).','imaging',2008,'HR 8799','This image shows three planets orbiting the star HR 8799. It was optained with the Keck II telescope on Hawaii. Credit: C. Marois et al., NRC Canada.','/Date(1384059600000)/',4,'HR 8799 d','false','null',7420224,12984878,'undefined',1334965471,7420221,12984878,'undefined',1334965471,'10','0.1','28','41054','27'),('The star HR 8799 is a young star in the constellation of Pegasus. It hostst a debri disk and at least 3 planets. The objects are near the upper limit for being planets. Objects are classified as brown dwarfs if they are capable of deuterium fusion (above 13 Jupiter masses).','imaging',2010,'HR 8799','This image shows three planets orbiting the star HR 8799. It was optained with the Keck II telescope on Hawaii. Credit: C. Marois et al., NRC Canada.','/Date(1696996800000)/',4,'HR 8799 e','false','null',7420225,12984878,'undefined',1334965471,7420221,12984878,'undefined',1334965471,'9','0','0','18000','14.5'),('The Kepler-20 system hosts at least five transiting exo-planets. Kepler-20 b has a period of only 3.7 days. Because it is about twice as big as the Earth, it is classified as a super-Earth or sub-Neptune. Kepler-20 b`s composition is ambiguous. It could be a terrestrial planet with a rocky surface or it could have a significant gas envelope.','transit',2011,'','','/Date(1636693200000)/',5,'Kepler-20 b','false','null',7420261,12984878,'undefined',1334965472,7420260,12984878,'undefined',1334965472,'0.027','0','86.5','3.696122','0.04537'),('The Kepler-20 system hosts at least five transiting exo-planets. Kepler-20 c has a low mean density which means it cannot be composed of rocky and iron material alone but must have a gas envelope.','transit',2011,'','','/Date(1636693200000)/',5,'Kepler-20 c','false','null',7420262,12984878,'undefined',1334965472,7420260,12984878,'undefined',1334965472,'0.051','0','88.39','10.8540916','0.093'),('The Kepler-20 system hosts at least five transiting exo-planets. Kepler-20 d has a low mean density and cannot be composed of rocky and iron material alone. The planet has an equilibtrium temperature of 95C (205F).','transit',2011,'','','/Date(1636693200000)/',5,'Kepler-20 d','false','null',7420263,12984878,'undefined',1334965472,7420260,12984878,'undefined',1334965472,'0.06','0','89.57','77.61185','0.3453'),('The Kepler-20 system hosts at least five transiting exo-planets. Kepler-20 e is most likely a rocky planet made of iron and silicates. It has approximately the size of Venus and is the first discovery of a sub-Earth size planet by the Kepler team. It is not habitable because the planet is on an orbit very close to its host star and the equilibrium temperature is as high as 1000 Kelvin (726C, 1340F). ','transit',2011,'','','/Date(1636693200000)/',5,'Kepler-20 e','false','null',7420264,12984878,'undefined',1334965472,7420260,12984878,'undefined',1334965472,'0','0','87.5','6.098493','0.06335'),('The Kepler-20 system hosts at least 5 transiting exo-planets. Kepler-20 f is orbiting the star every 20 days and has a size similar to that of Earth. It is too close to the star to be habitable. However, it could have developed a thick water vapour atmosphere. ','transit',2011,'','','/Date(1636693200000)/',5,'Kepler-20 f','false','null',7420265,12984878,'undefined',1334965472,7420260,12984878,'undefined',1334965472,'0','0','88.68','19.57706','0.1378'),('The planet Kepler-22b has been discovered with the Kepler spacecraft. It is orbiting the solar type Kepler target star KIC10593626. This puts it in the habitable zone with an equilibrium temperature of minus 11 degrees Celsius (plus 11 degrees Fahrenheit). If the planet has an atmosphere similar to that of Earth then the surface temperature is 22 degrees Celsius (71 degrees Fahrenheit). Kepler-22b is the smallest radius planet known to orbit in the habitable zone of any star other than the Sun.','transit',2011,'Kepler22b','This is an artist`s conception illustrating the exoplanet Kepler-22b. The planet lies in the habitable zone of a Sun-like star KIC10593626. The habitable zone around a star is usually defined to be the zone in which liquid water, a requirement for life on Earth, could persist. \n	\nScientists do not yet know if the planet has a predominantly rocky, gaseous or liquid composition. It`s possible that the world would have clouds in its atmosphere, as depicted here in the artist`s interpretation.\n	\nCredit: NASA/Ames/JPL-Caltech','/Date(1131771600000)/',1,'Kepler-22 b','false','null',7420269,12984878,'undefined',1334965472,7420268,12984878,'undefined',1334965472,'0','0','0','290','0.849'),('The exoplanet candidate KOI-13 b was discovered with the Kepler spacecraft. It has been independently confirmed by ellipsoidal variations in the lightcurve. The high temperature of the host star and the small semi-major axis make this planet one of the hottest exoplanets known. The equilibrium temperature is 2864K.','transit',2012,'','','/Date(1259730000000)/',1,'KOI-13 b','false','null',7420330,12984878,'undefined',1334965472,7420329,12984878,'undefined',1334965472,'8.3','0','85.9','1.76358914','0.0367'),('The young (2 Myr) solar analog LkCa 15 shows evidence for a (proto)planet surrounded by dusty material. The object is located in a known gap in the transitional disk. More planets might be present in this system. ','imaging',2011,'','','/Date(1573362000000)/',1,'LKCA 15 b','false','null',7420358,12984878,'undefined',1334965472,7420357,12984878,'undefined',1334965472,'6','0','0','40000','15.7'),('','RV',2000,'','','/Date(1031112000000)/',4,'mu Ara b','false','null',7420376,12984878,'undefined',1334965472,7420375,12984878,'undefined',1334965472,'1.676','0.128','0','643.25','1.5'),('','RV',2004,'','','/Date(1031112000000)/',4,'mu Ara c','false','null',7420377,12984878,'undefined',1334965472,7420375,12984878,'undefined',1334965472,'0.03321','0.172','0','9.6386','0.09094'),('','RV',2004,'','','/Date(1031112000000)/',4,'mu Ara d','false','null',7420378,12984878,'undefined',1334965472,7420375,12984878,'undefined',1334965472,'0.5219','0.0666','0','310.55','0.921'),('','RV',2006,'','','/Date(1031112000000)/',4,'mu Ara e','false','null',7420379,12984878,'undefined',1334965472,7420375,12984878,'undefined',1334965472,'1.814','0.0985','0','4205.8','5.235'),('','RV',2007,'','','/Date(1815278400000)/',1,'NGC 2423 3 b','false','null',7420381,12984878,'undefined',1334965472,7420380,12984878,'undefined',1334965472,'10.6','0.21','0','714.3','2.1'),('','RV',1996,'','','/Date(1570680000000)/',4,'ups And b','false','null',7420460,12984878,'undefined',1334965472,7420459,12984878,'undefined',1334965472,'0.69','0.013','30','4.617136','0.059'),('','RV',1999,'','','/Date(1320465600000)/',4,'ups And c','false','null',7420461,12984878,'undefined',1334965472,7420459,12984878,'undefined',1334965472,'14.57','0.24','8','237.7','0.861'),('','RV',1999,'','','/Date(1320465600000)/',4,'ups And d','false','null',7